        <li>css</li>  
        <li>html</li>  
        <li>js</li>  
        <li>react </li>  
      </ul>
    </div>
    </div>
  );
}

const Header = () => {
  return(
    <div>
      <a href='#'>Home</a>
      <a href='#'>News</a>
      <a href='#'>Feed</a>
      <a href='#'>Messages</a>
    </div>
  )
}

export default App;
